import React, { Component } from 'react';
import {Grid, Col, Image} from 'react-bootstrap';
import './Demo.css';

export default class About extends Component{

    render(){
        return(

            <div>
                <Image src="assets/dog-people.jpg" className="header-image"/>
                <Grid>
                 <Col xs={12} sm={8} smOffset={2}>
                    <Image src="assets/person-1.jpg" className ="about-profile-pic" rounded />
                    <h3>frank the tank</h3>
                    <p>The light is your friend. Preserve it. Put your feelings into it, your heart, it's your world. This is gonna be a happy little seascape.</p>
                    <p>Put light against light - you have nothing. Put dark against dark - you have nothing. It's the contrast of light and dark that each give the other one meaning.</p>
                    <p>You have to allow the paint to break to make it beautiful.</p>
                    <p>The light is your friend. Preserve it. Put your feelings into it, your heart, it's your world. This is gonna be a happy little seascape.</p>
                    <p>Put light against light - you have nothing. Put dark against dark - you have nothing. It's the contrast of light and dark that each give the other one meaning.</p>
                    <p>You have to allow the paint to break to make it beautiful.</p>
                 </Col>   
                </Grid>                
            </div>
        )
    }
}
